// FeaturedSlider.js
import React from "react";
import { Swiper, SwiperSlide } from "swiper/react";
import { Pagination, EffectCoverflow } from "swiper/modules";
import "swiper/css";
import "swiper/css/pagination";
import "swiper/css/effect-coverflow";
import "../styles/Slider.css";

const slides = [
  {
    title: "Midnight Moods",
    image:
      "src/images/MidnightMoods.jpg",
  },
  {
    title: "Party Starters",
    image:
      "https://github.com/ecemgo/mini-samples-great-tricks/assets/13468728/6ddf81f5-2689-4f34-bf80-a1e07f14621c",
  },
  {
    title: "Relaxing Tones",
    image:
      "https://github.com/ecemgo/mini-samples-great-tricks/assets/13468728/ab52d9d0-308e-43e0-a577-dce35fedd2a3",
  },
  {
    title: "Smooth Jazz Journey",
    image:
      "https://github.com/ecemgo/mini-samples-great-tricks/assets/13468728/20c8fdd5-9f4a-4917-ae90-0239a52e8334",
  },
  {
    title: "Uplifting Rhythms",
    image:
      "https://github.com/ecemgo/mini-samples-great-tricks/assets/13468728/df461a99-2fb3-4d55-ac16-2e0c6dd783e1",
  },
];

const FeaturedSlider = () => {
  return (
    <div className="slider-container">
      <h1>Popular Playlist</h1>
      <Swiper
        effect="coverflow"
        grabCursor={true}
        centeredSlides={true}
        loop={true}
        speed={600}
        slidesPerView="auto"
        coverflowEffect={{
          rotate: 10,
          stretch: 120,
          depth: 200,
          modifier: 1,
          slideShadows: false,
        }}
        pagination={{ el: ".swiper-pagination" }}
        modules={[EffectCoverflow, Pagination]}
        className="swiper"
      >
        {slides.map((slide, index) => (
          <SwiperSlide key={index} className="swiper-slide">
            <img src={slide.image} alt={slide.title} />
            <div className="slide-overlay">
              <h2>{slide.title}</h2>
              <button>
                Listen Now <i className="fa-solid fa-circle-play"></i>
              </button>
            </div>
          </SwiperSlide>
        ))}
        <div className="swiper-pagination"></div>
      </Swiper>
    </div>
  );
}

export default FeaturedSlider;
